"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 520px\">",
"   <div class=\"ttl\">",
"    Local injection for lateral epicondylitis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 500px; height: 318px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    For short-term relief of severe symptoms, glucorticoid injection is a reasonable treatment option when used as part of a comprehensive management program including physical therapy.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Bruce C Anderson, MD.",
"    </div>",
