"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?42/1/43030/abstract/1\">",
"      Herrington J, Carter-Su C. Signaling pathways activated by the growth hormone receptor. Trends Endocrinol Metab 2001; 12:252.",
"     </a>",
"    </li>",
