var title_f42_1_43033="Segmental pressure examination";
var content_f42_1_43033=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F58549&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F58549&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 622px\">",
"   <div class=\"ttl\">",
"    Segmental pressure examination",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 602px; height: 492px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A high thigh pressure that differs from the higher brachial systolic value by more than 30 mmHg is considered abnormal. A 20 mmHg or greater reduction between segments in the same leg or compared with the opposite leg at the same level (ie, right thigh/left thigh, right calf/left calf) is indicative of a flow-limiting lesion at that level.",
"    <br/>",
"    In this patient, the right high thigh pressure is abnormal and pressure gradients are present from the high to low thigh, low thigh to calf and calf to ankle indicative of multilevel disease. The ankle-brachial index of 0.17 is consistent with critical limb ischemia. The left extremity demonstrates mild tibial vessel disease with adequate collateralization. The left ankle-brachial index of 0.84 may be consistent with claudication.",
"    <div class=\"footnotes\">",
"     %: percent.",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of the Division of Vascular Surgery at OHSU.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
