var title_f42_1_43035="Iodine containing foods";
var content_f42_1_43035=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ENDO%2F75830&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ENDO%2F75830&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Foods to avoid for two weeks before 131-I scanning and treatment",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Iodized salt or sea salt, including salty snacks",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Milk or other dairy products (small amounts in prepared foods are allowed)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Eggs (small amounts in prepared foods are allowed)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Seafood, especially shellfish, kelp, or seaweed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Any item with added carrageen, agar-agar, algin, or alginates",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cured foods, such as ham, corned beef, and sauerkraut",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Breads (usually white breads) made from iodate dough conditioners",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Foods and medicine (eg, vitamin-mineral tablets) containing red food dyes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Chocolate",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Molasses",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Soy products",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Restaurant foods and Asian food",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pizza",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Chili",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Foods allowed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fresh meat",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Poultry",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Potatoes or rice",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Wheat or rye bread",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fresh or frozen vegetables",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fresh or frozen fruit",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Cavalieri RR. Nuclear imaging in the management of thyroid carcinoma. Thyroid 1996; 6:485.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
