"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Eisenmenger syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Acute or chronic thromboembolic disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
