"        &bull; Valvular pulmonic stenosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        &bull; Infundibular stenosis or obstruction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        - Tetralogy of Fallot",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        - Hypertrophic cardiomyopathy",
"       </td>",
"      </tr>",
"      <tr>",
