"        &bull; Branch",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        &bull; Peripheral",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Stenotic right ventricular to pulmonary artery conduit",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dextro-transposition of the great arteries after atrial baffle procedure (systemic right ventricle)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Congenitally corrected transposition of the great arteries (systemic right ventricle)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Cardiomyopathic processes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Right ventricular ischemia or infarction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dilated cardiomyopathy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Arrhythmogenic right ventricular cardiomyopathy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Endomyocardial fibrosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Tumors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cardiac myxomas",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Other primary cardiac tumors (eg, sarcomas, fibromas, rhabdomyomas)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Metastatic lesions (eg, melanoma, renal cell carcinoma)",
